pragma solidity ^0.4.24;

import "../../node_modules/openzeppelin-solidity/contracts/access/Roles.sol";

contract VuupleAdmins {
  using Roles for Roles.Role;

  event VuupleAdminAdded(address indexed account);
  event VuupleAdminRemoved(address indexed account);

  Roles.Role private VuupleAdmins;

  constructor()  { 
    _addVuupleAdmin(msg.sender);
  }

  modifier onlyVuupleAdmin() {
    require(isVuupleAdmin(msg.sender));
    _;
  }

  function isVuupleAdmin(address account) public view returns (bool) {
    return VuupleAdmins.has(account);
  }

  function addVuupleAdmin(address account) public onlyVuupleAdmin   returns (bool){
    _addVuupleAdmin(account);
    return true;
  }

  function renounceVuupleAdmin() public {
    _removeVuupleAdmin(msg.sender);
  }
  function removeVuupleAdmin(address account) public onlyVuupleAdmin{
    _removeVuupleAdmin(account);
  }

  function _addVuupleAdmin(address account) internal {
    VuupleAdmins.add(account);
    emit VuupleAdminAdded(account);
  }

  function _removeVuupleAdmin(address account) internal {
    VuupleAdmins.remove(account);
    emit VuupleAdminRemoved(account);
  }
}
